style.css:
body, html {
    background-color: white !important;
    color: black !important;
}

* {
    background-color: transparent !important;
    color: black !important;
}

p, span, div, li, h1, h2, h3, h4, h5, h6, a {
    color: black !important;
}

code, pre {
    background-color: #f5f5f5 !important;
    color: black !important;
}

a {
    color: blue !important;
}
